import React from 'react'
import './Sidebar.css'
import SidebarRow from './SidebarRow'
function Sidebar() {
    return (
        <div className="sidebar">
            <SidebarRow title="Home"/>
            <SidebarRow title="Trending" />
            <SidebarRow  title/>
        </div>
    )
}

export default Sidebar
